// import Layout from '../components/MyLayout.js'
import Header from '../components/Header.js'
import Link from 'next/link'
import { Component } from "react";

class HomePage extends Component {
  render() {
    return (
      <main>
        <Header />
        <h1>Magic 8 Ball</h1>
        <form className="question-input">
          <input type="text" ref="inputquestion" placeholder="Ask your question..." style={{width: "300px", fontSize:18}}/>
          <button ref="submitquestion" value="Shake Me" style={{width: "100px", fontSize:18}}/>
        </form>

        <p style={{ fontFamily:'Arial' }}>Your answer...</p>

        <style jsx>{`
          h1 {
            font-family:"Arial";
            font-size:50px;
          }`}
        </style>

      </main>
    )
  }
}

export default HomePage;
